import React from "react";
import {NavLink} from 'react-router-dom';
const Menu = () => {
  return (
    <>
      <NavLink ex activeClassName="active_class" to="/">
        AboutUS
      </NavLink>
      <NavLink activeClassName="active_class" to="/Contact">
        Contact
      </NavLink>
      <br />
      <br />
      <a href="/">AboutUS</a>
      <a href="/Contact">Contact</a>
    </>
  );
};

export default Menu;
